CREATE TABLE `app_users` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `role_id` int(11) DEFAULT NULL,
  `parent` int(11) DEFAULT '0',
  `full_name` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `user_name` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `email` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `password` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `business_name` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `industry_type` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `industry_name` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `other_type` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `address` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `postal_code` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `city` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `country` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `country_name` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `accounting_method` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `company_year_end_date` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  `year` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL,
  `status_id` int(11) DEFAULT NULL,
  `reset_token` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `is_verified` int(11) DEFAULT '0',
  `device_token` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `contact` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL,
  `language` varchar(45) COLLATE utf8_unicode_ci DEFAULT 'en',
  `image` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `is_subscribed` tinyint(2) DEFAULT '0' COMMENT '0 OR 1',
  `is_disabled` tinyint(2) DEFAULT '0',
  `is_child` tinyint(2) DEFAULT '0',
  `currency` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `free_package` tinyint(2) DEFAULT '0',
  `last_login` datetime DEFAULT NULL,
  `package_taken` tinyint(2) DEFAULT '0',
  `deleted` tinyint(2) DEFAULT '0',
  `permanent_delete` tinyint(2) DEFAULT '0',
  `default_card_id` varchar(150) COLLATE utf8_unicode_ci DEFAULT NULL,
  `customer_id` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL,
  `is_recur` tinyint(2) DEFAULT '0',
  `country_code` varchar(4) COLLATE utf8_unicode_ci DEFAULT NULL,
  `phone` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=331 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
