INSERT INTO `pages` VALUES (1,'Terms And Conditions','الأحكام والشروط','terms-and-conditions','<div style=\"padding: 25px;\">\r\n<h1 id=\"What_Are_Terms_And_Conditions_Agreements\"><span style=\"font-size: 36pt;\">Terms and Conditions Agreements</span></h1>\r\n<p><span style=\"font-size: 24pt;\">A Terms and Conditions agreement acts as a legal contract between you (the company) and the user. It\'s where you&nbsp;<strong>maintain your rights</strong>&nbsp;to exclude users from your app in the event that they abuse your website/app, set out the rules for using your service and note other important details and disclaimers.</span></p>\r\n<p><span style=\"font-size: 24pt;\">Having a Terms and Conditions agreement is completely optional. No laws require you to have one. Not even the super-strict and wide-reaching General Data Protection Regulation.</span></p>\r\n<p><span style=\"font-size: 24pt;\">Your Terms and Conditions agreement will be uniquely yours. While some clauses are standard and commonly seen in pretty much every Terms and Conditions agreement, it\'s up to you to set the rules and guidelines that the user must agree to.</span></p>\r\n<p><span style=\"font-size: 24pt;\">Terms and Conditions agreements are also known as Terms of Service or Terms of Use agreements. These terms are interchangeable, practically speaking.</span></p>\r\n</div>','<pre id=\"tw-target-text\" class=\"tw-data-text tw-text-large tw-ta\" dir=\"rtl\" data-placeholder=\"Translation\"><span class=\"Y2IQFc\" lang=\"ar\">التحقق من تغييرات الوصف العربي في هذا</span></pre>',NULL,'2022-09-07 19:05:21'),(2,'Privacy And Policy','الخصوصية والسياسة','privacy-and-policy','<div style=\"padding: 25px;\">\r\n<h6 id=\"What_Are_Terms_And_Conditions_Agreements\"><span style=\"font-size: 36pt; background-color: #ba372a;\">Privacy Policy</span></h6>\r\n<p><span style=\"font-size: 24pt;\">A Terms and Conditions agreement acts as a legal contract between you (the company) and the user. It\'s where you&nbsp;<strong>maintain your rights</strong>&nbsp;to exclude users from your app in the event that they abuse your website/app, set out the rules for using your service and note other important details and disclaimers.</span></p>\r\n<p><span style=\"font-size: 24pt;\">Having a Terms and Conditions agreement is completely optional. No laws require you to have one. Not even the super-strict and wide-reaching General Data Protection Regulation.</span></p>\r\n<p><span style=\"font-size: 24pt;\">Your Terms and Conditions agreement will be uniquely yours. While some clauses are standard and commonly seen in pretty much every Terms and Conditions agreement, it\'s up to you to set the rules and guidelines that the user must agree to.</span></p>\r\n<p><span style=\"font-size: 24pt;\">Terms and Conditions agreements are also known as Terms of Service or Terms of Use agreements. These terms are interchangeable, practically speaking.</span></p>\r\n</div>','<pre id=\"tw-target-text\" class=\"tw-data-text tw-text-large tw-ta\" dir=\"rtl\" data-placeholder=\"Translation\"><span class=\"Y2IQFc\" lang=\"ar\">التحقق من تغييرات الوصف العربي في هذاالتحقق من تغييرات الوصف العربي في هذاالتحقق من تغييرات الوصف العربي فالتحقق من تغييرات<br /> الوصف العربي في هذاالتحقق من تغييرات الوصف العربي في هذاالتحقق من تغييرات الوصف العربي في هذاالتحقق من تغييرات الوصف العربي<br /> في هذاالتحقق من تغييرات الوصف العربي في هذاالتحقق من تغييرات الوصف العربي في هذاالتحقق من تغييرات الوصف العربي في هذاي هذاالتحقق<br /> من تغييرات الوصف العربي في هذاالتحقق من تغييرات الوصف العربي في هذا<br /><br /></span></pre>',NULL,'2022-09-07 19:03:43');
