INSERT INTO `widgets` VALUES (1,'Revenue','fa fa-users','SELECT SUM(us.total_amount) AS `value` FROM `app_users`  au INNER JOIN `user_subscriptions` AS us ON au.id = us.user_id WHERE au.deleted=\'0\' AND au.parent=\"0\" ','active','1',NULL,NULL,NULL,'counter','col-6',NULL,NULL),(2,'Target',NULL,'SELECT COUNT(*) AS value FROM `user_subscriptions` WHERE EXISTS( SELECT * FROM `subscriptions` WHERE `user_subscriptions`.`subscription_id` = `subscriptions`.`id` AND `slug` = \'basic\')','inactive','2',NULL,NULL,NULL,'counter','col-6',NULL,NULL),(3,'Refund',NULL,'SELECT SUM(amount) AS `value` FROM `cancelled_subscriptions`','active','3',NULL,NULL,NULL,'counter','col-6',NULL,NULL);
